import React, { useState } from "react";
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
function About() {
  return (
    <div className="about">
      <p class="fs-1">About Me</p>
      <p>
        Lorem ipsum dolor sit amet consectetur adipisicing elit. Ipsam ea
        aperiam, blanditiis voluptas expedita minima itaque iusto similiipsum
        dolor sit amet consectetur adipisicing elit. Ipsam ea aperiam,
        blanditiis voluptas expedita minima itaque iusto similiipsum dolor sit
        amet consectetur adipisicing elit. Ipsam ea aperiam, blanditiis voluptas
        expedita minima itaque iusto similiipsum dolor sit amet consectetur
        adipisicing elit. Ipsam ea aperiam, blanditiis voluptas expedita minima
        itaque iusto similique, natus sequi consectetur qui totam iure. At
        corporis odit itaque delectus id.
      </p>
      <div class="row pt-5">
        <div class="col-sm-6 mb-3 mb-sm-0 ">
          <div class="card">
            <div class="card-body">
              <p class="card-text">
                <img  src="website.png" alt=""/>
                <div class="position-absolute top-50 start-50 translate-middle">Full Stack Web Developer</div>
              </p>
            </div>
          </div>
        </div>
        <div class="col-sm-6">
          <div class="card">
            <div class="card-body">
              <h5 class="card-title">Special title treatment</h5>
              <p class="card-text">
                With supporting text below as a natural lead-in to additional
                content.
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
function Portfolio() {
  return (
    <div class="row row-cols-1 row-cols-md-2 g-4">
  <div class="col">
    <div class="card">

      <div class="card-body">
        <h5 class="card-title">Card title</h5>
        <p class="card-text">This is a longer card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
      </div>
    </div>
  </div>
  <div class="col">
    <div class="card">

      <div class="card-body">
        <h5 class="card-title">Card title</h5>
        <p class="card-text">This is a longer card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
      </div>
    </div>
  </div>
  <div class="col">
    <div class="card">

      <div class="card-body">
        <h5 class="card-title">Card title</h5>
        <p class="card-text">This is a longer card with supporting text below as a natural lead-in to additional content.</p>
      </div>
    </div>
  </div>
  <div class="col">
    <div class="card">

      <div class="card-body">
        <h5 class="card-title">Card title</h5>
        <p class="card-text">This is a longer card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
      </div>
    </div>
  </div>
</div>
  );
}





function Contact() {
  return (
    <Form>
      <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
        <Form.Label>Email address</Form.Label>
        <Form.Control type="email" placeholder="name@example.com" />
      </Form.Group>
      <Form.Group className="mb-3" controlId="exampleForm.ControlTextarea1">
        <Form.Label>Example textarea</Form.Label>
        <Form.Control as="textarea" rows={3} />
      </Form.Group>
      <Button variant="secondary">Submit</Button>{' '}
    </Form>
  );
}




function App() {
  const [showAbout, setShowAbout] = useState(true);
  const [showPortfolio, setShowPortfolio] = useState(false);
  const [showContact, setShowContact] = useState(false);

  const handleAboutClick = () => {
    setShowAbout(true);
    setShowPortfolio(false);
    setShowContact(false);
  };

  const handlePortfolioClick = () => {
    setShowAbout(false);
    setShowPortfolio(true);
    setShowContact(false);
  };

  const handleContactClick = () => {
    setShowAbout(false);
    setShowPortfolio(false);
    setShowContact(true);
  };

  return (
    <div id="infoCard" class="card">
      <nav class="navbar">
        <form class="container-fluid justify-content-end">
          <button
            id="btn"
            class="btn btnAbout"
            type="button"
            onClick={handleAboutClick}
          >
            About
          </button>
          <button
            id="btn"
            class=" btn btnPortfolio"
            type="button"
            onClick={handlePortfolioClick}
          >
            Portfolio
          </button>
          <button
            id="btn"
            class=" btn btnContact"
            type="button"
            onClick={handleContactClick}
          >
            Contact
          </button>
        </form>
      </nav>
      <div id="root" class="card-body">
        {showAbout && <About />}
        {showPortfolio && <Portfolio />}
        {showContact && <Contact />}
      </div>
    </div>
  );
}

export default App;
